import { Container, Jumbotron } from 'react-bootstrap';

import SearchForm from './components/SearchForm';
import Results from './components/Results';

function App() {
  return (
    <div>
      <Jumbotron>
        <Container>
          <h1>Best Bank</h1>
          <p>This is a simple banking app</p>
          <SearchForm />
        </Container>
      </Jumbotron>
      <Results />
    </div>
  );
}

export default App;
